import React from "react";
import "./App.css";
import Home from "./Components/Home/Home";
const App = () => {
  return (
    <div className="app">
      <Router>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
};

export default App;
